  false,\n\t\"url\": null,\n\t\"notes\": \"NODC Accession 0138185 includes physical
  and underway data collected aboard the ROBERT GORDON SPROUL during cruise SP1219
  in the North Pacific Ocean from 2012-10-11 to 2012-10-12. These data include CURRENT
  SPEED - EAST/WEST COMPONENT (U) and CURRENT SPEED - NORTH/SOUTH COMPONENT (V). The
  instruments used to collect these data include ADCP and GPS. These data were collected
  by Douglas Bartlett of University of California - San Diego; Scripps Institution
  of Oceanography as part of Active Microbial Populations at Depth. The Lamont-Doherty
  Earth Observatory (LDEO) submitted these data to NODC as part of the NSF sponsored
  Rolling Deck to Repository (R2R) program.nnThe ADCP data represent the raw and automated
  processed data set. Post processed quality assessed data are not available in this
  accession.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
